import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <nav className="navbar navbar-dark bg-dark nav-pills nav-justified ">
        <h1 className="nav-item nav-link" >Casey Medford</h1>
            <a className="nav-item justify-content-end" href="https://www.linkedin.com/in/casey-medford-a7a411169?trk=people-guest_profile-result-card_result-card_full-click" target="_blank"><h2>LinkedIn</h2> </a> 
            <a className=" justify-content-end" href="#AboutMe"><h2>About Me</h2></a> 
            <a className=" justify-content-end" href="https://github.com/casamed" target="_blank"> <h2>GitHub</h2> </a> 
      </nav>

      <div className="card">
          <div className="card-body">
            <h5 className="card-title">Card title</h5>
            <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
            <a href="#" className="btn btn-primary">Go somewhere</a>
          </div>
      </div>





    </div>
  );
}

export default App;
